import clickAudio from "../../click_audio_func/click_audio_func";
import hoverAudio from "../../hover_audio_func/hover_audio_func";
import TopNav from "../../top_nav_comp/js/topNav";
import "../css/verants.css";
import { useEffect, useRef, useState } from "react";
export default function VerantsPage() {

  function checkIfActive(e,func) {
    if (!(e.currentTarget.style.backgroundColor === "var(--default-select-background-color)" && e.currentTarget.style.outlineColor === "var(--verants-main-color)")) {
        func();
    }
}

  return (
    <div className="verants-page-main-container">
      <TopNav verants={true} />
      <div className="verants-page-container">
        <div onMouseOver={(e) => {checkIfActive(e,hoverAudio)}} className="verants-buy-main-container">

        </div>
      </div>
    </div>
  );
}
